'''Phan Thế Hùng''' (sinh 1942) là [[đại biểu Quốc hội Việt Nam]] [[Quốc hội Việt Nam khóa X|khóa X]]. Ông thuộc đoàn đại biểu [[Hải Phòng]].<ref>{{chú thích web|url=http://dbqh.na.gov.vn/X/Daibieu.aspx|title=Danh sách Đại biểu Quốc hội khóa X|access-date =ngày 5 tháng 9 năm 2012|archive-date = ngày 26 tháng 1 năm 2013 |archive-url=https://web.archive.org/web/20130126074720/http://dbqh.na.gov.vn/X/Daibieu.aspx}}</ref>

Ông từng là Bí thư Trung ương Đoàn, Bí thư Tỉnh ủy Vĩnh Phúc.

